export const Certificates = () => {
    const generateRandomValue = () => {
        return Math.floor(Math.random() * 100) - 50;
    };

    return (
        <div className={"container"}>
            <div className={"bubbles"}>
                {[...Array(7)].map((_, i) => (
                    <span
                        key={i}
                        style={{ "--tx": generateRandomValue(), "--ty": generateRandomValue() }}
                    ></span>
                ))}
            </div>
        </div>
    );
};
